// import "./styles/App.css";

export default function App() {
  console.log(useLocation().pathname);
  return (
    <div>
      <Navigation />
      <Routes>
        <Route path="/" element={<IndexPage />} />
        <Route path="/staffSalary" element={<StaffSalaryPage />} />
      </Routes>
    </div>
  );
}
